import React, { Component } from 'react'
import Card from "../card/Card"
import data from '../games.json'

export default class home extends Component {
    constructor(props){
        super(props)
        this.state={
            games: data.games
        }
    }
    render() {
        return (
            <div>
                <div className="container">
        {this.state.games.map(game=>(
          <Card game= {game}/>
        ))}
      </div>
            </div>
        )
    }
}
